    t[44206] = "Statistics.Confidence.More.Info";
    t[44207] = "<p>\nFor output of confidence intervals stochastically independent measured values are necessary.<br>\nThe performance indicators recorded during the simulation of a queuing system, are, usually, not independent.<br>\nTherefore, for generating confidence intervals, the measured values have to be combined into groups between them there<br>\nis (almost) no dependency anymore. This is usually done using the Batch Means method.\n</p>\n<p><br></p>\n<p>\nBy splitting the simulation into several threads, a (rather rough) grouping is already available.<br>\nThe confidence data currently displayed are based on this rough breakdown and therefore represent an upper estimate.\n</p>\n<p><br></p>\n<p>\nThe recording of batch-means-based confidence intervals can be activated on the <b>Output analysis</b> page<br>\nin the <b>Model properties</b> dialog. A batch size has to be specified for this. This can be determined<br>\nautomatically in advance via the menu item <b>Determine statistics batch size</b> in the <b>Simulation</b> menu.\n</p>";
